extendedTextMessage.text:
🙌 ¡Hola! Bienvenido/a al Gimnasio *[Nombre del Gimnasio]*. ¿En qué puedo ayudarte hoy?.
Elije una opcion para rapida respuesta
🔹 te comparto los siguientes links de interés sobre el proyecto:
👉 *1* Información sobre precios y Horarios
👉 *2* Clases y actividades
👉 *3* Servicios adicionales
[object Object]
async (ctx, { gotoFlow, fallBack, flowDynamic }) => {
            if (!["1", "2", "3"].includes(ctx.body)) {
                return fallBack("❌ Respuesta no válida, por favor selecciona una de las opciones.");
            }
            switch (ctx.body) {
                case "1":
                    return gotoFlow(flowInfo);
                case "2":
                    return gotoFlow(flowClases);
                case "3":
                    return gotoFlow(flowService);
                default:
                    return await flowDynamic("🔚 Saliendo... Puedes volver a acceder a este menú escribiendo 'menu'.");
            }
        }
